
//The input will be a number of lines. Each line contains a single string without spaces.

//The strings have at least one number in them, each.

//The first and last number must be combined from each string.
//These digits form a 2 digit number.

// Add all of the numbers together

// ex: he33llo => 33. 
// mxmkjvgsdzfhseightonetwoeight7 = > 77
// 3five4s84four9rtbzllggz => 39.

//Note how if there is only 7 digit it simply repeats. Any digits in the middle are just ignored.

//There will always be at least 1 digit

//no timeouts, just compute the job
//edge cases: strings can be short just 1 digit 1 letter. 
//no invalid inputs

function sums(calData){

  let words = calData.trim().split(" ");

  function replaceWords(words){
    //replace the words with digits
    let numberStr = "one two three four five six seven eight nine"
    let numberArr = numberStr.split(" ");
    // console.log(numberArr);
    //examine each line
    for (let i=0;i<words.length;i++){
      //replace each digit
      // console.log("looking at word", words[i])
      for (let j=0;j<numberArr.length;j++){
        words[i] = words[i].replaceAll(numberArr[j], (j+1).toString());
        // console.log("modified word:", words[i])
      }
    }
    return words;
  } 
  
  //replace the words for numbers with digits
  words = replaceWords(words);
  console.log(words);

  //This was the original code, just going through strings and making numbers then adding them all up:

  // console.log("first word:", words[0]);
  let sum = 0;
  let digits = "";

  let char1 = "";
  let char2 = "";

  let word = [];

  for (let i=0;i<words.length;i++){
    // console.log("word being examined", words[i]);
    word = words[i].split("");
    // console.log("word arr:", word);
    
    //Look for digit first
    char1 = word.find(el => +el>=0 && +el <=9);
    // console.log("char1:", char1);
    
    //second digit
    char2 = word.findLast(el => +el>=0 && +el <=9);

    digits = char1 + char2;
    // console.log(digits);
    sum += +digits;

  } 
  return sum;
};

